using System;
using System.Diagnostics;
using System.Linq;
using System.Security.Cryptography;
using System.Text;

namespace LeetCode
{
    class Program
    {
        static void Main(string[] args)
        {
            Console.WriteLine(LongestPalindrome(""));
            Console.WriteLine(LongestPalindrome(""));
            Console.WriteLine(LongestPalindrome(""));
            Console.WriteLine(LongestPalindrome(""));
            Console.WriteLine(LongestPalindrome(""));
            Console.ReadLine();
        }

        static string LongestPalindrome(string s)
        {
            if (string.IsNullOrWhiteSpace(s) || s.Length == 1)
                return s;

            int max_len = 0;
            int cur_idx0 = 0;
            int cur_idx1 = s.Length - 1;

            for (int i = 0; i < s.Length; i++)
            {
                for (var j = s.Length - 1; j > i; j--)
                {
                    int idx0 = i;
                    int idx1 = j;
                    bool flag = true;
                    while (idx0 < idx1)
                    {
                        if (s[idx0] != s[idx1])
                        {
                            flag = false;
                            break;
                        }
                        idx0++;
                        idx1--;
                    }
                    if (flag && j - i + 1 > max_len)
                    {
                        max_len = j - i + 1;
                        cur_idx0 = i;
                        cur_idx1 = j;
                    }
                }
            }

            return s.Substring(cur_idx0, cur_idx1 - cur_idx0 + 1);
        }
    }
}
